sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	if (inputs.status_code == "200") {
		outputs.status = "Success";
		outputs.account_details = JSON.parse(inputs.response);
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.getAccountDetailsErrorHandler(inputs, outputs);
})(inputs, outputs);

